import React from 'react';
import styled from "styled-components";
function Home(props) {
    return (
        <div>
        <div className = 'container'>
        <h1>hi</h1>
        </div>
        </div>
    );
}
styled.div.className = 'container'`
h1{
    background-color : "blue"
}
`;

export default Home;
